function(){
/* 
"aLookUp" returns the content group-number (from first column), if URL contains the value from the second column. Set up content groups in UA first, then match the numbers with these.
*/
    var aLookUp = [
        [1, "/basics/?"],
        [2, "/routines/?"],
        [3, "/lifestyle/?"],
      	[4, "/solutions/?"],
      	[5, "/coloplast/?"]
    ],
    i,
    nLen = aLookUp.length,
    oRegEx,
    sURI = window.location.href;

    for (i = nLen; i--;) {
        oRegEx = new RegExp(aLookUp[i][1]);
        if (oRegEx.test(sURI)) return aLookUp[i][0];
    }
    return undefined;
}

